import React from "react";

import "./login.scss";
import wordLogo from "../../images/word-logo.png";

class Login extends React.Component {
  render() {
    return (
      <div className="main-login">
        <header className="main-login-header">
          <img className="main-login-word-logo" src={wordLogo} />
          <h1>Sign In</h1>
          <h3>Film Flix</h3>
        </header>
        <button className="main-login-sign-in-button">Sign In</button>
      </div>
    );
  }
}

export default Login;
